With this overview, we can now give an example of each of the four types of messages. In general, we assume that services are organized into at least three files: lib.rs -- the caller-side API that formats native Rust data into IPC messages main.rs the server-side API that unpacks IPC messages and acts on them api.rs -- data structures & definitions shared between caller and callee Note that none of these are mandatory -- for example, a pure client-side library like our AES implementation has only a lib.rs; and, an application that offers no services and has only a main function would have only a main.rs. Below is an example of what these files might look like in a very minimal server implementation. // inside lib.rs
pub mod api;
pub use api::*;
use xous::{CID, send_message};
use num_traits::*;
use core::sync::atomic::{AtomicU32, Ordering};
static REFCOUNT: AtomicU32 = AtomicU32::new(0); pub struct MyService { conn: CID,
}
impl MyService { pub fn new() -> Self { let xns = xous_names::XousNames::new().expect("couldn't connect to XousNames"); REFCOUNT.fetch_add(1, Ordering::Relaxed); let conn = xns.request_connection_blocking(api::SERVER_NAME_MYSERVICE).expect("Can't connect to MyService"); MyService { conn } } // ------ library methods to be discussed in detail below ------
}
/// Automatic disconnect on dropping the final instance of this connection
impl Drop for MyService { fn drop(&mut self) { if REFCOUNT.fetch_sub(1, Ordering::Relaxed) == 1 { unsafe{xous::disconnect(self.conn).unwrap();} } }
} // inside api.rs
pub(crate) const SERVER_NAME_MYSERVICE: &str = "_Any descriptive and unique name under 64 chars_"; #[derive(num_derive::FromPrimitive, num_derive::ToPrimitive, Debug)]
pub(crate) enum Opcode { /// Define various operations here DoNonSync, // ------ API opcodes to be discussed in detail below ------ /// Exits the server Quit,
} // inside main.rs
#![cfg_attr(target_os = "none", no_main)] mod api;
use api::*;
use num_traits::*; #[xous::xous_main]
fn xmain() -> ! { log_server::init_wait().unwrap(); log::set_max_level(log::LevelFilter::Info); log::info!("my PID is {}", xous::process::id()); let xns = xous_names::XousNames::new().unwrap(); let sid = xns.register_name(api::SERVER_NAME_MYSERVER, None).expect("can't register server"); loop { let msg = xous::receive_message(sid).unwrap(); match FromPrimitive::from_usize(msg.body.id()) { Some(Opcode::DoNonSync) => xous::msg_scalar_unpack!(msg, _, _, _, _, { // do stuff here }), // ------ options to be discussed in detail below ------ Some(Opcode::Quit) => { xous::return_scalar(msg.sender, 1).expect("couldn't ack quit"); break; }, None => log::error!("couldn't convert opcode: {:?}", msg), } } // clean up our program xns.unregister_server(sid).unwrap(); xous::destroy_server(sid).unwrap(); xous::terminate_process(0)
} With the above template in mind, click on the following for examples of each of the four patterns, broken down into each of Scalar and Memory types when applicable. Non-synchronizing Synchronous . Includes an example of how to use raw messages (instead of rkyv) for serializing data. Asynchronous or "push notifications" Deferred response Forwarding messages

