A Basis within the PDDB holds a virtual filesystem that is unionized with the other Bases. A Basis is protected with a name and password combination. Neither the name nor the password, nor a hash or salt for a password, is stored within the PDDB, as such records would be a sidechannel revealing the existence of a secret Basis. Thus the confidentiality of a Basis is derived entirely from the strength of the password, but there is a generic, per-device salt (perhaps more accurately called a "pepper") that means brute force attackers must prepare hash tables unique to each device. A Basis is defined by two keys: A 256-bit page table key, used to derive an AES cipher run in ECB A 256-bit data key, used to derive an AES-GCM-SIV cipher The cryptographic matter pertaining specifically to the PDDB is stored in raw FLASH in a header with the following structure: #[repr(C)]
pub(crate) struct StaticCryptoData { /// a version number for the block pub(crate) version: u32, /// aes-256 key of the system basis page table, encrypted with the User0 root key, and wrapped using NIST SP800-38F pub(crate) system_key_pt: [u8; WRAPPED_AES_KEYSIZE], /// aes-256 key of the system basis, encrypted with the User0 root key, and wrapped using NIST SP800-38F pub(crate) system_key: [u8; WRAPPED_AES_KEYSIZE], /// a pool of fixed data used for salting. The first 32 bytes are further subdivided for use in the HKDF. pub(crate) salt_base: [u8; 4096 - WRAPPED_AES_KEYSIZE * 2 - size_of::<u32>()],
} The structure is sized to be exactly one page of memory, with the "remaining" data filled with TRNG-derived salt. The version number is considered a "hint", as it is not signature protected and there are no anti-rollback measures. The PDDB has a default Basis called .System, which has its page table and data keys stored as wrapped keys by the device's root enclave. It is the only Basis treated in this manner. All other Bases are derived from the name and password of the basis, as hashed by salt_base. Any Basis that is not the .System Basis is referred to as a "secret Basis".

